import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import dataService from '../services/dataService';

const ManageUsers = () => {
  const navigate = useNavigate();
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedUser, setSelectedUser] = useState(null);
  const [showModal, setShowModal] = useState(false);

  // Mock users data matching your screenshot
  const mockUsers = [
    {
      id: 4,
      username: 'dj@123',
      email: 'dj@gmail.com',
      createdAt: 'Apr 21, 2025'
    },
    {
      id: 3,
      username: 'tej@123',
      email: 'tej@gmail.com',
      createdAt: 'Apr 21, 2025'
    },
    {
      id: 2,
      username: 'sx@123',
      email: 'wsxedc@gmail.com',
      createdAt: 'Apr 21, 2025'
    },
    {
      id: 1,
      username: 'Wsx@123',
      email: 'wsx@gmail.com',
      createdAt: 'Apr 20, 2025'
    }
  ];

  useEffect(() => {
    // Fetch users from centralized data service
    const fetchUsers = async () => {
      try {
        setLoading(true);
        const usersData = await dataService.getAllUsers();
        setUsers(usersData);
      } catch (error) {
        console.error('Error fetching users:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchUsers();
  }, []);

  const handleViewUser = (user) => {
    setSelectedUser(user);
    setShowModal(true);
  };

  const handleDeleteUser = (userId) => {
    if (window.confirm('Are you sure you want to delete this user?')) {
      setUsers(users.filter(user => user.id !== userId));
    }
  };

  if (loading) {
    return (
      <div className="d-flex" style={{ minHeight: '100vh' }}>
        {/* Sidebar */}
        <aside style={{ width: 200, background: '#2c3e50', color: '#fff', minHeight: '100vh' }} className="p-3">
          <h4 className="text-white mb-4">Admin Panel</h4>
          <ul className="nav flex-column">
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin')}>
                <i className="fas fa-tachometer-alt me-2"></i> Dashboard
              </button>
            </li>
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/cars')}>
                <i className="fas fa-motorcycle me-2"></i> Vehicles
              </button>
            </li>
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2 active" onClick={() => navigate('/admin/users')}>
                <i className="fas fa-users me-2"></i> Users
              </button>
            </li>
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/bookings')}>
                <i className="fas fa-calendar-alt me-2"></i> Bookings
              </button>
            </li>
          </ul>
        </aside>

        {/* Main Content */}
        <main className="flex-grow-1" style={{ background: '#ecf0f1' }}>
          <div className="text-center p-5">
            <div className="spinner-border text-primary" role="status">
              <span className="visually-hidden">Loading...</span>
            </div>
            <p className="mt-3">Loading users...</p>
          </div>
        </main>
      </div>
    );
  }

  return (
    <div className="d-flex" style={{ minHeight: '100vh' }}>
      {/* Sidebar */}
      <aside style={{ width: 200, background: '#2c3e50', color: '#fff', minHeight: '100vh' }} className="p-3">
        <h4 className="text-white mb-4">Admin Panel</h4>
        <ul className="nav flex-column">
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin')}>
              <i className="fas fa-tachometer-alt me-2"></i> Dashboard
            </button>
          </li>
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/cars')}>
              <i className="fas fa-motorcycle me-2"></i> Vehicles
            </button>
          </li>
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2 active" onClick={() => navigate('/admin/users')}>
              <i className="fas fa-users me-2"></i> Users
            </button>
          </li>
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/bookings')}>
              <i className="fas fa-calendar-alt me-2"></i> Bookings
            </button>
          </li>
        </ul>
      </aside>

      {/* Main Content */}
      <main className="flex-grow-1" style={{ background: '#ecf0f1' }}>
        <div className="d-flex justify-content-between align-items-center p-4 bg-white border-bottom">
          <h2 className="mb-0">Manage Users</h2>
          <button className="btn btn-outline-danger btn-sm" onClick={() => { localStorage.removeItem('token'); navigate('/admin/login'); }}>
            <i className="fas fa-sign-out-alt me-1"></i> Logout
          </button>
        </div>

        <div className="p-4">
          <div className="bg-white rounded shadow-sm">
            <div className="table-responsive">
              <table className="table table-striped mb-0">
                <thead style={{ background: '#f8f9fa' }}>
                  <tr>
                    <th className="px-4 py-3">ID</th>
                    <th className="px-4 py-3">Username</th>
                    <th className="px-4 py-3">Email</th>
                    <th className="px-4 py-3">Created At</th>
                    <th className="px-4 py-3">Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {users.map((user) => (
                    <tr key={user.id}>
                      <td className="px-4 py-3">{user.id}</td>
                      <td className="px-4 py-3">{user.username}</td>
                      <td className="px-4 py-3">{user.email}</td>
                      <td className="px-4 py-3">{user.createdAt}</td>
                      <td className="px-4 py-3">
                        <button
                          className="btn btn-info btn-sm me-2"
                          onClick={() => handleViewUser(user)}
                        >
                          <i className="fas fa-eye me-1"></i> View
                        </button>
                        <button
                          className="btn btn-danger btn-sm"
                          onClick={() => handleDeleteUser(user.id)}
                        >
                          <i className="fas fa-trash me-1"></i> Delete
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </main>

      {/* User Details Modal */}
      {showModal && selectedUser && (
        <div className="modal fade show" style={{ display: 'block', backgroundColor: 'rgba(0,0,0,0.5)' }}>
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">User Details - ID: {selectedUser.id}</h5>
                <button
                  type="button"
                  className="btn-close"
                  onClick={() => {
                    setShowModal(false);
                    setSelectedUser(null);
                  }}
                ></button>
              </div>
              <div className="modal-body">
                <div className="row">
                  <div className="col-12">
                    <h6 className="fw-bold mb-3">User Information</h6>
                    <p><strong>ID:</strong> {selectedUser.id}</p>
                    <p><strong>Username:</strong> {selectedUser.username}</p>
                    <p><strong>Email:</strong> {selectedUser.email}</p>
                    <p><strong>Created At:</strong> {selectedUser.createdAt}</p>
                    <p><strong>Status:</strong> <span className="badge bg-success">Active</span></p>
                  </div>
                </div>
              </div>
              <div className="modal-footer">
                <button
                  type="button"
                  className="btn btn-secondary"
                  onClick={() => {
                    setShowModal(false);
                    setSelectedUser(null);
                  }}
                >
                  Close
                </button>
                <button
                  type="button"
                  className="btn btn-danger"
                  onClick={() => {
                    handleDeleteUser(selectedUser.id);
                    setShowModal(false);
                    setSelectedUser(null);
                  }}
                >
                  Delete User
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default ManageUsers;
